import Add from './images/addTask.svg';
import './App.css';
import TaskList from './TaskList';
import EditTask from './EditTask';
import DeleteTask from './DeleteTask';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div class="menu">
          <TaskList/>
          <EditTask/>
          <DeleteTask/>
        </div>
        <h2 class="title">MA LISTE DES TACHE </h2>
        <p class="plan">S'organiser , c'est doublé sa productivité, alors planifies tes journées</p>
        <img src={Add} className="Task-Add" alt="Add task" />

        <img src={brain} className="Task-Add" alt="Add task" />
        <img src={done} className="Task-Add" alt="Add task" />
        <img src={grow} className="Task-Add" alt="Add task" />
        <img src={plan} className="Task-Add" alt="Add task" />
        <img src={rocke} className="Task-Add" alt="Add task" />

        <p>
          Ajouter une tâche 
        </p>
      </header>
    </div>
  );
}

export default App;
